import { Component } from "react";

import logo from "./logo.svg";
import "./App.css";

class App extends Component {
  constructor() {
    super();
    this.state = {
      name: {
        firstName: "Neesha",
        lastName: "Rattansingh",
      },
      company: "Youtie",
    };
  }
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            My name is {this.state.name}, I have a small business named{" "}
            {this.state.company}!
          </p>
          <button
            onClick={() => {
              this.setState({ name: "Pien" });
            }}
          >
            Change Name
          </button>
        </header>
      </div>
    );
  }
}

export default App;
